// api/dashboardApi.js
import axiosInstance from '../utils/axiosInstance';

export const fetchAnalytics = async (timeRange) => {
  try {
    const { data } = await axiosInstance.get(`/analytics?timeRange=${timeRange}`);
    return data;
  } catch (error) {
    console.error('Error fetching analytics:', error);
    throw error;
  }
};
